import react from 'react';

const Spinner = (props) => {
  return (
    <div class="ui segment">
      <div class="ui active dimmer">
        <div class="ui text loader">{props.loadMsg}</div>
      </div>
    </div>
  );
};

Spinner.defaultProps = {
  loadMsg: 'Loading...',
};

export default Spinner;
